import Input from "../Input";

const SignInForm: React.FC = () => {
  const [login, setLogin] = useState<string>("");
  return (
    <form>
      <h1>Sign In</h1>
      <Input
        label="Login"
        name="login"
        value={login}
        onChange={(event: React.MouseEvent) => console.log(event)}
      />
    </form>
  );
};

export default SignInForm;
